import React from "react";
// import logo from "./logo.svg";
import MainContainer from "./containers/MainContainer";
import { DefaultRoutes } from "./lib/routes/DefaultRoutes";
import { AuthRoutes } from "./lib/routes/AuthRoutes";
import AuthContainer from "./containers/AuthContainer";
import NotFound from "./containers/NotFound";
import { Redirect, Route, Switch } from "react-router-dom";
import { createGlobalStyle } from "styled-components";
import reset from "styled-reset";
import StreamContainer from "./containers/StreamContainer";
import RecordContainer from "./containers/RecordContainer";
import TICContainer from "./containers/Record/TICContainer";

const DefaultComponent = createGlobalStyle`
    ${reset};
    body {
    width: 100%;
    height: 100%;
    margin: 0;
    padding: 0;
    }
    a {
        text-decoration: none;
    }
`;

function App() {
  return (
    <>
      <DefaultComponent />
      <Switch>
        <Route exact path="/">
          <Redirect to="/stream" />
        </Route>
        <AuthRoutes exact path="/stream" component={MainContainer}></AuthRoutes>
        <AuthRoutes
          exact
          path="/stream/:key"
          component={StreamContainer}
        ></AuthRoutes>
        <DefaultRoutes
          exact
          path="/auth/:sub"
          component={AuthContainer}
        ></DefaultRoutes>
        <AuthRoutes
          exact
          path="/video"
          component={RecordContainer}
        ></AuthRoutes>
        <AuthRoutes
          exact
          path="/video/:key"
          component={TICContainer}
        ></AuthRoutes>
        <Route component={NotFound} />
      </Switch>
    </>
  );
}

export default App;
